import * as React from "react";
import { Container, Content } from "native-base";
import { StyleSheet, View, Text, ImageBackground } from "react-native";
import { AppFooter } from "./components/AppFooter";
import { NativeRouter, Route } from "react-router-native";
import { StarScreen } from "./components/star/Star";
import { MyCity } from "./components/mycity/MyCity";
import { AllCities } from "./components/all-cities/All-Cities";
import { Provider as PaperProvider } from "react-native-paper";
import { City } from "./components/city/City";

const styles = StyleSheet.create({
  container: {
    padding: 20,
  },
  back: {
    flex: 1,
    flexDirection: "column",
    resizeMode: "stretch",
  },
});

const App = () => {
  return (
    <PaperProvider>
      <NativeRouter>
        <Container>
          <ImageBackground
            source={require("./images/background.png")}
            style={styles.back}
          >
            <Content>
              <View style={styles.container}>
                <Route exact path="/myCity" component={MyCity} />
                <Route path="/starScreen" component={StarScreen} />
                <Route path="/allCities" component={AllCities} />
                <Route path="/city" component={City}></Route>
              </View>
            </Content>
          </ImageBackground>
          <AppFooter />
        </Container>
      </NativeRouter>
    </PaperProvider>
  );
};

export default App;
